import React, { useState } from 'react'
import GetRadon from './GetRadon';

function Selector() {

    function radonClick () {
        
        return (
            <div>
                <GetRadon />
            </div>
        )
    }
    return (
        <div>
            <button className='button' type="button" onClick={radonClick}>Radon</button>
            <button className='button' type="button" onClick={bc_maapClick}>BC-MAAP</button>
            <button className='button' type="button" onClick={bc_mageeClick}>BC-Magee</button>
            <button className='button' type="button" onClick={mp_grimmClick}>MP-GRIMM</button>
            <button className='button' type="button" onClick={mpClick}>Multi-parametro</button>
            <button className='button' type="button" onClick={radiometroClick}>Radiometro</button>
            
        </div>
    );
};

export default Selector;
